import React from 'react';

const Movie = (props) => {
    return (
        <div>

            <div className="card" style="width: 18rem;">
            </div>

            <h1>{props.name}</h1>

            <h3>Price: {props.price}</h3>

            <p>{props.desc}</p>

        </div>
    );
};

export default Movie;
